import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
const Home = () =>{
    return(
        <>
        
        <section className="header">
            <div className="row">
                <div className="col-10 mx-auto">
                <div className="row">
                    <div className="col-6">
                        <h1>Welcome To Home Page<span>Asad Rehman</span></h1>
                    </div>
                </div>

                </div>
            </div>
        </section>

        </>
    )
}

export default Home;
